import Foot from'./Footer';
import logo from './thor.jpg'

const root = ReactDOM.createRoot(document.getElementById('root'));
    <img src={logo} alt='log'/>
    root.render(
  <React.StrictMode>
    <Head />
    <Content/>
    <Foot/>
</React.StrictMode>
);
